import React, { Component } from 'react';
import SearchForm from "./search/SearchForm"
import './App.css';

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      value: "test"
    }
  }

  setValue = e => {
    console.log(e)
    let value = e.value ? e.value : ""
    this.setState({value})
  }

  render() {
    return (
      <div className="App">
        <SearchForm value={this.state.value} onChange={this.setValue} placeholder="testing placeholder"/>
      </div>
    );
  }
}

export default App;
